function sWorkspaceId = wGetActiveWorkspace(Wasdi)% Gets the active workspace ID% Syntax% sWorkspaceId = wGetActiveWorkspace(Wasdi)% % INPUT%    Wasdi: Wasdi object created after the wasdilib call%% OUTPUT%   sWorkspaceId: the ID of active WASDI workspace  if exist("Wasdi") < 1     disp('Wasdi variable does not exist')    return   end      sWorkspaceId = char(Wasdi.getActiveWorkspace());   end